import React from "react";
import {Button} from "react-materialize";

type MyProps = {
  message: string;
};
type MyState = {
  count: number;
};

class Home extends React.Component<MyProps, MyState> {
  state: MyState = {
    count: 2
  }

  render() {
    return (
      <div>
        <Button>Hi</Button>
        <h1>{this.props.message}: {this.state.count}</h1>
      </div>
    );
  }
}

export default Home;
